    <Card title={title} headStyle={{color:color,backgroundColor:bgc,fontWeight:'bold'}} bordered={true} style={{boxShadow:'rgba(0, 0, 0, 0.2) 2px 2px 6px'}}>
      <p>$</p>
      {/* <Doughnut data={...} /> */}
    </Card>
  )
}

export default Details
